import React from "react";
import NavBar from "./components/NavBar";
import Footer from "./components/Footer";
import Main from "./components/Main";
const App = (): JSX.Element => {
    return (
        <div className="container">
            <NavBar />
            <Main />
            <Footer />
        </div>
    )
};
export default App;
